import './App.css';
import LOGO from "./assets/logo.png"
/**
 * Header
 *  -Logo
 *  -nav-bar
 * Body
 *  -search
 *  -filter
 *  -sort
 *  -restraurants cards
 *      -
 * Footer
 *  -links
 */

const Header = ()=>{
  return(
    <div className="header">
      <div className="log-cotainer">
        <img className="logo" src={LOGO}/>
      </div>
      <div className="nav-items">
          <ul>
            <li>Home</li>
            <li>About us</li>
            <li>Contact Us</li>
            <li>Cart</li>
          </ul>
      </div>
    </div>
  )
}

const Body = ()=>{
  return(
    <div className="body">
      <div className="search">Search</div>
      <div className="res-container">
          <RestraurantCard/>
          <RestraurantCard/><RestraurantCard/><RestraurantCard/><RestraurantCard/><RestraurantCard/><RestraurantCard/>
      </div>
    </div>
  )
}

const RestraurantCard = ()=>{
  return(
    <div className="res-card">
      <h3>Homely Bites</h3>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <Header/>
      <Body/>
    </div>
  );
}

export default App;
